import React from 'react';
import ReactDOM from 'react-dom';

const AppList = () => {
  const items = [items1, items2]
  return (
    <ul>
      <li>{items1[0]}</li>
      <li>{items[1]}</li>
    </ul>
  );
}

const AppHeader = () => {
  return <h1>Hello World!</h1>
}

const App = () => {
  return (
    <>
      <AppHeader />
      <AppList />
      <AppList />
    </>
    );
}


ReactDOM.render(<App />, document.getElementById('root'));
